"use strict";(self.webpackChunkrandelltuazon=self.webpackChunkrandelltuazon||[]).push([[9936],{3401:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"can","metadata":{"permalink":"/blogs/drafts/can","source":"@site/blogs/drafts/2023-11-14.md","title":"","description":"I can be your bestfriend, or your lover.","date":"2023-11-14T00:00:00.000Z","formattedDate":"November 14, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.405,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"can","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"nextItem":{"title":"","permalink":"/blogs/drafts/draft-1"}},"content":"I can be your bestfriend, or your lover. <br/>\\nI can be your true love, or your one-night-stand. <br/>\\nI can be your husband, or your paramour. <br/>\\nI can be your prince, or your slave. <br/>\\nI can be your hero. <br/>\\nI can be your fool. <br/>\\nI can be your knight in shining armour. <br/>\\nI can be your everything. <br/>\\nI can be anything you want me to be. <br/>\\nJust tell me what you want. <br/>"},{"id":"draft-1","metadata":{"permalink":"/blogs/drafts/draft-1","source":"@site/blogs/drafts/2023-11-13.md","title":"","description":"She\'s breaking my heart, every single day without halt,","date":"2023-11-13T00:00:00.000Z","formattedDate":"November 13, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.11,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"draft-1","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/can"},"nextItem":{"title":"","permalink":"/blogs/drafts/rather-not"}},"content":"She\'s breaking my heart, every single day without halt, <br/>\\nand the piteous thing about it is it\'s not even her fault."},{"id":"rather-not","metadata":{"permalink":"/blogs/drafts/rather-not","source":"@site/blogs/drafts/2023-11-12-rather-not.md","title":"","description":"If you are not to be my wife, I would rather not marry...","date":"2023-11-12T00:00:00.000Z","formattedDate":"November 12, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.065,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"rather-not","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/draft-1"},"nextItem":{"title":"","permalink":"/blogs/drafts/draft-2"}},"content":"If you are not to be my wife, I would rather not marry..."},{"id":"draft-2","metadata":{"permalink":"/blogs/drafts/draft-2","source":"@site/blogs/drafts/2023-11-12.md","title":"","description":"Hopeless at love, for love for me is only you.","date":"2023-11-12T00:00:00.000Z","formattedDate":"November 12, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.05,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"draft-2","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/rather-not"},"nextItem":{"title":"","permalink":"/blogs/drafts/draft-3"}},"content":"Hopeless at love, for love for me is only you."},{"id":"draft-3","metadata":{"permalink":"/blogs/drafts/draft-3","source":"@site/blogs/drafts/2023-11-11.md","title":"","description":"Love me... not in this world.","date":"2023-11-11T00:00:00.000Z","formattedDate":"November 11, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.125,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"draft-3","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/draft-2"},"nextItem":{"title":"","permalink":"/blogs/drafts/not-ready"}},"content":"Love me... not in this world. <br/>\\nLove me... not at this moment. <br/>\\nLove me... next time. <br/>\\nBut please... do love me. <br/>"},{"id":"not-ready","metadata":{"permalink":"/blogs/drafts/not-ready","source":"@site/blogs/drafts/2023-11-10.md","title":"","description":"Past my thirties, I admit I feel like I\'m still not ready.","date":"2023-11-10T00:00:00.000Z","formattedDate":"November 10, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.525,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"not-ready","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/draft-3"},"nextItem":{"title":"","permalink":"/blogs/drafts/weary"}},"content":"Past my thirties, I admit I feel like I\'m still not ready. <br />\\nI am far from perfection, by my own standards. <br />\\nI don\'t want to be that good guy today, and fool around ten years after. <br />\\nAnd I\'ve seen enough good guys turn to monsters. Most of them are friends. <br />\\nOr maybe I\'m just overly ambitious, always in pursuit of greatness. <br />\\nOr I became too tough that I can live alone. <br />\\nAnd maybe I\'ll never be perfect nor ready. <br />\\nI will only have to settle on admiring you afar. <br />"},{"id":"weary","metadata":{"permalink":"/blogs/drafts/weary","source":"@site/blogs/drafts/2023-11-09.md","title":"","description":"I have grown weary from only watching and waiting.","date":"2023-11-09T00:00:00.000Z","formattedDate":"November 9, 2023","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.155,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"weary","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/not-ready"},"nextItem":{"title":"","permalink":"/blogs/drafts/darkest-days"}},"content":"I have grown weary from only watching and waiting. <br />\\nNow marks the time perfectly for some soul-searching. <br />\\nAnd maybe... just maybe, I\'ll find you too. <br />"},{"id":"darkest-days","metadata":{"permalink":"/blogs/drafts/darkest-days","source":"@site/blogs/drafts/2016-11-20.md","title":"","description":"The darkest days of my life have arrived,","date":"2016-11-20T00:00:00.000Z","formattedDate":"November 20, 2016","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.22,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"darkest-days","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/weary"},"nextItem":{"title":"","permalink":"/blogs/drafts/code-of-perfection"}},"content":"The darkest days of my life have arrived, <br />\\nthat I\'m not entirely sure whether I\'ll survive. <br />\\nAnd there\'s not even a single soul I can talk to about. <br />\\nYou won\'t even see it in my eyes. <br />"},{"id":"code-of-perfection","metadata":{"permalink":"/blogs/drafts/code-of-perfection","source":"@site/blogs/drafts/2015-11-16.md","title":"","description":"Codes of Perfection I live by:","date":"2015-11-16T00:00:00.000Z","formattedDate":"November 16, 2015","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.3,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"code-of-perfection","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/darkest-days"},"nextItem":{"title":"","permalink":"/blogs/drafts/just-a-dream"}},"content":"Codes of Perfection I live by: <br/>\\nDress like James Bond. Fight like Statham. <br/>\\nThink like Steve Jobs. Style like Johnny Depp. <br/>\\nAct like a gentleman. <br/>\\nWrite like Hank Moody. Live like Larry Crowne. <br/>\\nPlay like Michael Jordan. Drive like Vin Diesel. <br/>\\nTrain like The Rock. Chase the Dream, <br/>\\nand Beat that Zucker. <br/>"},{"id":"just-a-dream","metadata":{"permalink":"/blogs/drafts/just-a-dream","source":"@site/blogs/drafts/2015-07-06.md","title":"","description":"So it was just a dream. Still felt like so god damn real.","date":"2015-07-06T00:00:00.000Z","formattedDate":"July 6, 2015","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.31,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"just-a-dream","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/code-of-perfection"},"nextItem":{"title":"","permalink":"/blogs/drafts/full-of-drunks"}},"content":"So it was just a dream. Still felt like so god damn real. <br/>\\nBut you\'re too good to be true, it\'s surreal. <br/>\\nThat\'s how I knew it\'s just a fucking dream, but still. <br/>\\nFor you, I\'ll always be dreamin\'. <br/>\\nBecause I am a dreamer, and you are mine. <br/>\\nCome again, and don\'t ever wake me up. <br/>"},{"id":"full-of-drunks","metadata":{"permalink":"/blogs/drafts/full-of-drunks","source":"@site/blogs/drafts/2014-11-13.md","title":"","description":"In a house full of drunks, and cheats and loud sound,","date":"2014-11-13T00:00:00.000Z","formattedDate":"November 13, 2014","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.325,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"full-of-drunks","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/just-a-dream"},"nextItem":{"title":"","permalink":"/blogs/drafts/why"}},"content":"In a house full of drunks, and cheats and loud sound, <br/>\\nHardly the place where love\'s likely to be found. <br/>\\nI was the lone man sober, and yet more mad, <br/>\\nGlued in one corner by myself, seeming odd. <br/>\\nWhile all men were looking for the easy one to fuck, <br/>\\nThere I was a fool, waiting and looking for love. <br/>"},{"id":"why","metadata":{"permalink":"/blogs/drafts/why","source":"@site/blogs/drafts/2014-09-26.md","title":"","description":"Why do I admire you? But why even bother asking?","date":"2014-09-26T00:00:00.000Z","formattedDate":"September 26, 2014","tags":[{"label":"draft","permalink":"/blogs/drafts/tags/draft"}],"readingTime":0.4,"hasTruncateMarker":false,"authors":[{"name":"Randell Tuazon","title":"Dev/Poet/Writer","url":"https://www.instagram.com/randelltuazon","imageURL":"https://2.gravatar.com/avatar/8d15e5eb3cd8eb14ada9c614f65cb4c53693993a98a784a05f0b2ba31e6bee46?size=128","key":"randelltuazon"}],"frontMatter":{"slug":"why","title":"","authors":["randelltuazon"],"keywords":["randell tuazon","draft"],"tags":["draft"]},"prevItem":{"title":"","permalink":"/blogs/drafts/full-of-drunks"}},"content":"Why do I admire you? But why even bother asking? <br/>\\nIt\'s a long list of countless reasons I have already lost track of. <br/>\\nMaybe it is your grace, my perfect preference of a lady. <br/>\\nOr maybe it is your beauty, such is my eye candy. <br/>\\nI can give you thousand reasons more, <br/>\\nand while all of them would be true, the fact is, I fancy you. <br/>\\nAnd I don\'t even really know why. <br/>"}]}')}}]);